        async Task<string> ConsultarCliente(string tel)
        {
            string url = $"http://localhost:3036/api/Clientes/cliente/{tel}";
            HttpClient http = new HttpClient();
            var peticion = await http.GetAsync(url);
            var clienet = new Cliente();
            if (peticion.IsSuccessStatusCode)
            {
                var datos = await peticion.Content.ReadAsStringAsync();
                clienet = JsonConvert.DeserializeObject<Cliente>(datos);
            }

            string retornar = OpcionInvalida + welcomeMessageInicio;
            if (clienet != null)
            {
                retornar = Opcionvalida + welcomeMessage;
            }

            return retornar;
        }

